import styled from "styled-components"


export const Section = styled.div`
margin: 1em;
    justify-content: center;
    align-items: center;


`

export const VideoBanner = styled.div`
width: 100px;
height: 100px;
`

export const videoContainer = styled.div`
object-fit: contain;
    position: absolute;
    top: 0;
    bottom: 0;
    width: 100px;
    height: 50px; 
    overflow: hidden;

`
